import React, { Component } from 'react';

  class Diagnosis extends Component{

  	constructor(props) {
   	 super(props);
         this.state = {
      	 contacts: []
    	};
	}

 	componentDidMount() {
        fetch('https://sandbox-healthservice.priaid.ch/symptoms?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..zP5NTHgRfPd9jOT6TbyArvkonIDCfRtArldjF1KzcQM&language=en-gb&format=json')
        .then(res => res.json())
        .then((data) => {
        	this.setState({ contacts: data })
        })
        .catch(console.log)
    }
    
  	render(){
  		return (

  		  <div className="symptoms">
          <div className="SymptomsContainer">

              <h1>Symptom List</h1>

          </div>
          {this.state.contacts.map((contact) => (

          	 <div className="card">
              <div className="card-body">
                <h2 className="card-title">{contact.Name}</h2>
               
               </div>
             </div>
           
          ))}
        </div>

  		   
  		);
  	}
}

export default Diagnosis;

